"use strict";(self.webpackChunklmos_website=self.webpackChunklmos_website||[]).push([[9133],{7222:(e,n,t)=>{t.r(n),t.d(n,{assets:()=>l,contentTitle:()=>o,default:()=>c,frontMatter:()=>i,metadata:()=>r,toc:()=>d});var a=t(4848),s=t(8453);const i={title:"Agent Development",description:".",date:new Date("2025-01-17T00:00:00.000Z"),authors:[{name:"Rahul Jamwal"}],tags:["AI","LMOS","Agents"]},o="Agent Development",r={permalink:"/lmos/blog/AgentDevelopment",source:"@site/blog/AgentDevelopment.md",title:"Agent Development",description:".",date:"2025-01-17T00:00:00.000Z",tags:[{inline:!0,label:"AI",permalink:"/lmos/blog/tags/ai"},{inline:!0,label:"LMOS",permalink:"/lmos/blog/tags/lmos"},{inline:!0,label:"Agents",permalink:"/lmos/blog/tags/agents"}],readingTime:16.05,hasTruncateMarker:!0,authors:[{name:"Rahul Jamwal",key:null,page:null}],frontMatter:{title:"Agent Development",description:".",date:"2025-01-17T00:00:00.000Z",authors:[{name:"Rahul Jamwal"}],tags:["AI","LMOS","Agents"]},unlisted:!1,nextItem:{title:"Spring.ai Integration",permalink:"/lmos/blog/Spring.AI-integration"}},l={authorsImageUrls:[void 0]},d=[{value:"Development Phase",id:"development-phase",level:3},{value:"Step functions:",id:"step-functions",level:4},{value:"Flow of Prompts:",id:"flow-of-prompts",level:4},{value:"Retrieved Augmented Generation:\xa0",id:"retrieved-augmented-generation",level:4},{value:"Backend APIs:\xa0",id:"backend-apis",level:4},{value:"Prompting - Dynamic, natural language based:",id:"prompting---dynamic-natural-language-based",level:4},{value:"Validation Phase",id:"validation-phase",level:3},{value:"Annotations:",id:"annotations",level:4},{value:"Business Validations:",id:"business-validations",level:4},{value:"Monitoring and Improvements",id:"monitoring-and-improvements",level:3},{value:"Differences - Agents vs Traditional development",id:"differences---agents-vs-traditional-development",level:4}];function h(e){const n={a:"a",blockquote:"blockquote",h3:"h3",h4:"h4",img:"img",li:"li",p:"p",strong:"strong",ul:"ul",...(0,s.R)(),...e.components};return(0,a.jsxs)(a.Fragment,{children:[(0,a.jsx)(n.p,{children:"In a world increasingly powered by AI, creating reliable and efficient agents isn\u2019t just about technology but also about processes, strucutures and methodologies. This blog will take you behind the scenes of our agent development, and the various phases involved until production rollout."}),"\n",(0,a.jsx)(n.p,{children:"The development of an AI agent, much like a traditional development, begins with a requirements elicitation and documentation phase. However, the agent development has many different and additional phases which we briefly will touch upon in this article. A simplified diagrammatic view of agent development might look something as this:"}),"\n",(0,a.jsx)(n.p,{children:(0,a.jsx)(n.img,{alt:"Alt text",src:t(2170).A+"",width:"1816",height:"1128"})}),"\n",(0,a.jsx)(n.p,{children:"To begin with, we first look at the production dataset available for conversations and service tickets created by our human agents."}),"\n",(0,a.jsx)(n.p,{children:"In most CRM systems, there is a broad classification already available underneath which few set of conversation details are logged by human agents.\nFor example, there might a conversation with the customer related to a 5G network issue, this may be logged in the CRM system under Network issues category which may have further subcategories.\xa0"}),"\n",(0,a.jsx)(n.p,{children:"We looked at this information and determined the categories for which the largest number of tickets were logged in a month. For example, Customers may be calling mostly for Billing related queries. Using these statistics available from production, it is determined which Business domain should be prioritized first.\nAn extensive analysis of this CRM data is done to determine the different category of problems a customer seeks help for under the Billing domain. For each category it is determined what set of knowledge will be required to answer or help with those queries or problems. In some cases the knowledge is right away available from the CRM tickets but in other cases, we may have to scrap data off from webpages, pdf documents or other available knowledge APIs."}),"\n",(0,a.jsx)(n.p,{children:"As such, the outcome of the Requirements phase is that we usually end up with a detailed story, which is then further broken down into multiple stories for different Teams:"}),"\n",(0,a.jsxs)(n.ul,{children:["\n",(0,a.jsx)(n.li,{children:"Knowledge Operations Team"}),"\n",(0,a.jsx)(n.li,{children:"AI Agent Engineering Team"}),"\n",(0,a.jsx)(n.li,{children:"Data Science Team"}),"\n",(0,a.jsx)(n.li,{children:"Security and Compliance Team"}),"\n"]}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"Knowledge Operations Team"})," is usually tasked with building pipelines to scrap data off sources such as help and support pages etc, and integrating these pipelines with the vector search services to convert this data into embeddings representations stored in vector databases."]}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"Agent Engineering Team"})," is tasked with development of AI agents that orchestrate and interact with other agents, models, and services in order to cater to the queries for the domain to which that agent belongs."]}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"Agent Data Science Team"})," takes care of determining what is the best model to be used for the specific use cases and language. Our Data Science team also writes initial prompts and runs them through several iterations to get the desired results."]}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"Security and Compliance Team"})," helps out with providing guidelines and doing assessments to ensure we stay compliant to all the GDPR and other security, privacy, and ethical guidelines."]}),"\n",(0,a.jsx)(n.p,{children:"Here is an example story, our teams usually create sub-tasks or sub-stories under each story for different teams."}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.p,{children:"Example story:"}),"\n",(0,a.jsx)(n.p,{children:"As a Billing agent, I need to use all relevant knowledge and prompts at my disposal to appropriately answer one of the following Billing query."}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"Agent inscope capabilities:"}),"\nThe billing agent must be able to answer anything related to the following:"]}),"\n",(0,a.jsxs)(n.ul,{children:["\n",(0,a.jsx)(n.li,{children:"Breakdown of bill - Explain  and elucidate any question related to tax calculation,\xa0extra data usage charges, recurring bill amounts."}),"\n",(0,a.jsx)(n.li,{children:"Bill amount surge - In cases  when backend provides supporting data, the agent must be able to answer  why my current bill is higher than last month's bill."}),"\n",(0,a.jsx)(n.li,{children:"Compare bills - Be able to compare bills for two months and spot the differences leading to a higher      bill amount."}),"\n",(0,a.jsx)(n.li,{children:"Link to down bills - ability  to fetch and share urls for last three month bills."}),"\n",(0,a.jsx)(n.li,{children:"Charge codes on bill - be able to explain special charge codes on the bills in details for example 'RCMG-1mon' may suggest an international charge code on the bill for one month."}),"\n",(0,a.jsx)(n.li,{children:"Third party references - be able to refer the customer to third party portals when there is a third      party charge on the bill."}),"\n",(0,a.jsx)(n.li,{children:"Bill cycles - be able to  guide the customer how bill cycle can be changed if needed."}),"\n",(0,a.jsx)(n.li,{children:"Payment status - be able to answer which bills have been fully paid and which have an outstanding amount."}),"\n"]}),"\n",(0,a.jsx)(n.p,{children:(0,a.jsx)(n.strong,{children:"Agent out of scope capabilities:"})}),"\n",(0,a.jsxs)(n.ul,{children:["\n",(0,a.jsx)(n.li,{children:"Following would be consider out of scope for the capabilities of the agent:"}),"\n",(0,a.jsx)(n.li,{children:"Anything that is classified as non-billing question by the intent classifier."}),"\n",(0,a.jsx)(n.li,{children:"Anything in the Billing intent but which requires access to specific data that is currently not available."}),"\n",(0,a.jsx)(n.li,{children:"Anything related to helping the customer make an instant payment using the agent."}),"\n"]}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"KPIs:"})," The agent's success criteria would be coverage of 90% of the in-scope queries with a resolution rate of 80%, 5% fabricating information, and 2% risky information."]}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"Decision framework:"}),"\xa0Production agent conversation data was analyzed. A classification was made on the high level support type tickets, and it was determined that 50% of the support queries are related to Billing.\nWith this agent going live and meeting the defined KPIs, we expect to deflect approximately 5000 daily calls off the call center."]}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"Utterances:"}),"\nSample utterances as noted from our agent conversation database, is attached for references and for tests and validations.\xa0\xa0This data has been refined by our Team of data scientists to make it usable for tests and validations."]}),"\n",(0,a.jsx)(n.p,{children:(0,a.jsx)(n.strong,{children:"Test Data:"})}),"\n",(0,a.jsxs)(n.ul,{children:["\n",(0,a.jsx)(n.li,{children:"Account existing in the billing system with a bill having consecutive surge over last two months - 2342938498"}),"\n",(0,a.jsx)(n.li,{children:"Account with only one paid bill in the last three months - 342342342"}),"\n",(0,a.jsx)(n.li,{children:"Account with special international roaming charge and OTT subscription charge - 9273293482"}),"\n"]}),"\n",(0,a.jsx)(n.p,{children:(0,a.jsx)(n.strong,{children:"Samples best response examples as per Utterances dataset:"})}),"\n",(0,a.jsx)(n.p,{children:"Use this data as an example for LLMs, prompt refinements and/or multi-shot trainings."}),"\n",(0,a.jsx)(n.p,{children:"Sample Conversation1"}),"\n",(0,a.jsx)(n.p,{children:"Sample Conversation2"}),"\n",(0,a.jsx)(n.p,{children:"Sample Conversation3"}),"\n"]}),"\n",(0,a.jsx)(n.h3,{id:"development-phase",children:"Development Phase"}),"\n",(0,a.jsx)(n.p,{children:"In the development phase our teams undertake several tasks. LMOS platform minimizes the developers efforts and ensures most of the recurring steps and complex interactions are taken care of so developer can only focus on the key enhancements related to the Business domain."}),"\n",(0,a.jsx)(n.p,{children:"Here are some examples:"}),"\n",(0,a.jsx)(n.h4,{id:"step-functions",children:"Step functions:"}),"\n",(0,a.jsx)(n.p,{children:"Several common functions that have to be undertaken by an agent have been modeled as a step, for example, if there is a url that has been generated by the LLM then it is ascertained in this step whether this is a whitelisted url that can be passed back to the customer or not (removing hallucinated urls). We maintain an easily configurable list of urls that can be updated through a simple CMS frontend by anyone."}),"\n",(0,a.jsx)(n.p,{children:"Another example might be to classify and rephrase the complete previous LLM conversation so it can be passed as a contextual information in the next request to the LLM."}),"\n",(0,a.jsx)(n.p,{children:"In general the development of most agents require some pre-defined mandatory steps which are take care of by the platform, for example logging final response, but some steps are configurable and can be skipped depending on capabilities needed from the agent."}),"\n",(0,a.jsx)(n.p,{children:"There might be many existing steps which are provided by the platform, however depending on the capabilities needed in the agent and Business use cases, new steps may have to be introduced by our Teams. It is carefully ascertained if something can be incorporated as a step in core platform or if it can be added as a validation code in the agent. Our team of architects and software designers take appropriate decisions to guide our team members as needed."}),"\n",(0,a.jsx)(n.p,{children:"For a case when dynamic control is needed, flow of prompts are modified using pre-defined, configurable templates."}),"\n",(0,a.jsx)(n.h4,{id:"flow-of-prompts",children:"Flow of Prompts:"}),"\n",(0,a.jsx)(n.p,{children:"In several cases, the execution flow for an agent may require some dynamic modifications in run time or may need tweaks via prompt engineering without any code interventions by the Engineering teams."}),"\n",(0,a.jsx)(n.p,{children:"These would be the classic cases such as depending on the input language, region, tenant or channel we may have to execute some specific code, for example it might be an IVR channel and an additional step might be needed to fine tune the tone or conciseness of the response.\nThis flow of prompts is usually defined via prompt templates, and we have prompt templates created for every agent.\n\xa0"}),"\n",(0,a.jsx)(n.h4,{id:"retrieved-augmented-generation",children:"Retrieved Augmented Generation:\xa0"}),"\n",(0,a.jsx)(n.p,{children:"For every new agent, accessing RAG knowledge is all about writing a single line of code, and specifying the tenant since LMOS platform natively supports multi-tenancy and decides, on the basis of tenant input, as to which RAG database to query for embeddings."}),"\n",(0,a.jsx)(n.p,{children:"However, with each new agent, we have to supplement the RAG with new knowledge of the domain. Some of this knowledge is available from pdfs, some from help and support pages and some from pre-existing anonymized conversations."}),"\n",(0,a.jsxs)(n.p,{children:["In each case, we have dedicated knowledge pipelines which are integrated with our search services and these knowledge sources are connected to these pipelines to extract and transform the data into embedding representations stored in our vector databases. This is a task that is undertaken by our Knowledge Operations Team that scours the available resources for the best source of knowledge and\xa0integrate them into our pipelines.\nRAG is a big topic and you can read more about it at ",(0,a.jsx)(n.a,{href:"https://learn.microsoft.com/en-us/azure/search/retrieval-augmented-generation-overview",children:"RAG overview"}),"."]}),"\n",(0,a.jsx)(n.h4,{id:"backend-apis",children:"Backend APIs:\xa0"}),"\n",(0,a.jsx)(n.p,{children:"There are several cases where specific information pertaining to a user's usage is required, as such an access to some backend APIs is required.\nIn our system, we have a carefully guarded backend database accessible only via a secure API layer after appropriate authentication & authorizations through a central gateway. Access is strictly controlled on a need to know basis and limited only to required non-private datasets."}),"\n",(0,a.jsxs)(n.p,{children:["Based on the Business use cases, several new APIs may be required to be invoked.\nThe developers write corresponding ",(0,a.jsx)(n.strong,{children:"LLM functions"})," for every API that caters to a specific business case, these functions on the basis of Business domains are grouped together with clear annotated descriptions and information for each of these APIs is passed to the LLM to understand which functions is needed to invoke a specific API for fetching specific details."]}),"\n",(0,a.jsxs)(n.p,{children:["Each such ",(0,a.jsx)(n.strong,{children:"LLM function"})," also goes through privacy and security review to ensure we stay compliant to norms and regulations, and entity recognition models (Anonymization models) are used to determine and scrub SPI data."]}),"\n",(0,a.jsx)(n.p,{children:"LMOS platform takes care of the underlying complexities such as:"}),"\n",(0,a.jsxs)(n.ul,{children:["\n",(0,a.jsx)(n.li,{children:"Transforming the functions to appropriate API request models as per LLM API specifications."}),"\n",(0,a.jsx)(n.li,{children:"Invocation of APIs as requested by the LLM via functions."}),"\n",(0,a.jsx)(n.li,{children:"Transforming the response back into a an LLM API format."}),"\n",(0,a.jsx)(n.li,{children:"Handling the LLM response and handing over to the agent for further processing."}),"\n"]}),"\n",(0,a.jsx)(n.h4,{id:"prompting---dynamic-natural-language-based",children:"Prompting - Dynamic, natural language based:"}),"\n",(0,a.jsx)(n.p,{children:"Our ARC DSL allows anyone from the team to define prompts in a simple natural language. The prompt engineer has an arsenal of dynamic functions which can be used in prompts to enhance the prompt in real time with additional information which can be fetched from the system during an actual flow. For example, you might want to send a specific url to the LLM depending on the type of customer asking the query, if it is a Business customer there might be a greeting or formal tone to be used. The separation between ARC module for prompting and platform code module allows faster prompt iterations, easy modifications and quicker deployments."}),"\n",(0,a.jsx)(n.p,{children:"In many cases depending on the Business requirements our teams may require to write new functions which can be used in the dynamic prompt flows."}),"\n",(0,a.jsx)(n.p,{children:"Since prompts also support multi-tenancy there can be a different prompt which is configurable per channel and tenant for the same step. For example for prompt flow step of 'ClassifyAnswer' you can have a different prompt for IVR and different prompt for chat conversations."}),"\n",(0,a.jsx)(n.p,{children:"During prompt engineering, our Agent Data Science team iteratively tweaks & validates the prompts so that the BOT response reaches a specific quality threshold."}),"\n",(0,a.jsx)(n.p,{children:"In addition during prompt engineering, the Data Science members may also take several decision regarding whether to add additional knowledge into the knowledge database or supplement some information within prompts."}),"\n",(0,a.jsx)(n.p,{children:"The supplemented knowledge may be about some general information that a BOT is supposed to know in terms of the guidelines of an organizations about communications with the customers, or some procedures followed to do something on behalf of the customer. In such cases, usually pdfs or other sources are procured, data is parsed processed, refined into a format and it can either be added as an information in the prompts or it can be added in the RAG by passing via embedding models."}),"\n",(0,a.jsx)(n.p,{children:"In some cases, it is ascertained that some dynamic information is needed during runtime on the basis of which the LLM is supposed to take appropriate decisions. For example, In some cases it might be helpful for the LLM to know how many services the customer currently has so as to be able to answer better."}),"\n",(0,a.jsx)(n.p,{children:"In other cases, it might be noticed that disambiguation is needed and the LLMs are instructed to ask specific number of queries in order to better understand the customer's query or to help with a better resolution."}),"\n",(0,a.jsx)(n.h3,{id:"validation-phase",children:"Validation Phase"}),"\n",(0,a.jsx)(n.h4,{id:"annotations",children:"Annotations:"}),"\n",(0,a.jsx)(n.p,{children:"Responses generated by an LLM powered system are not always accurate, factually correct and reliable. One should ensure to integrate a human in the loop approach for any system that is powered by LLMs before rolling out major functionalities/changes into production specifically for applications where high stakes are involved."}),"\n",(0,a.jsx)(n.p,{children:"Chatbot applications may need human feedbacks in many different cases/scenarios:"}),"\n",(0,a.jsxs)(n.ul,{children:["\n",(0,a.jsx)(n.li,{children:"Evaluate the system before rolling out a new feature in production."}),"\n",(0,a.jsx)(n.li,{children:"Recurring regression evaluations to uncover any unknown issues."}),"\n",(0,a.jsx)(n.li,{children:"Evaluate a new model, maybe for anonymization or embedding."}),"\n",(0,a.jsx)(n.li,{children:"Knowledge retrieval and ranking."}),"\n"]}),"\n",(0,a.jsx)(n.p,{children:"For the LMOS platform, for any new feature or Business domain that is introduced it is always ensured that human evaluators are sharing their feedbacks in a preprod environment before that feature goes live. Our framework has an integrated step 'Response Evaluation' through which another LLM is used to determine the quality and appropriateness of response before passing it on to the customer, however for any new major developments our team always ensures to have human evaluators evaluate the system typically on edge cases that may not conform to typical patterns."}),"\n",(0,a.jsx)(n.p,{children:"Conversations or queries are fed into the LMOS agents via a chat frontend, and the complete conversational record turn by turn is saved into a database. We currently make use of Opensearch, and ensure each conversation and every message in the conversation can be uniquely identified with a conversationId, turnId respectively."}),"\n",(0,a.jsx)(n.p,{children:"These conversations or queries are obtained from a processed dataset of conversational records from our CRM systems. In case you have a chat based system (LLM based or guided decision tree based chat system) you can also use these chat conversations, refine & process them into a format that can be fed into this system to generate responses for evaluations.\xa0"}),"\n",(0,a.jsx)(n.p,{children:"These generated conversations are basically scrapped via a script and refined into a specific dataset format which can be accepted by a specific tool used for evaluation. For evaluation of our LMOS agentic system, we make use of Argilla which allows us to define and adapt the evaluation criteria and questions as per our requirements. Argilla also supports displaying UI elements like tile, card etc. in case your chat application makes use of those so that the human evaluators are aware of how information was presented to the customers."}),"\n",(0,a.jsx)(n.p,{children:"The human evaluators are supposed to rate every response on certain parameters for example:"}),"\n",(0,a.jsxs)(n.ul,{children:["\n",(0,a.jsx)(n.li,{children:"Does this response contain any sensitive information ?\xa0"}),"\n",(0,a.jsx)(n.li,{children:"How appropriate is this response on a scale of 1-5 ?"}),"\n"]}),"\n",(0,a.jsx)(n.p,{children:"After the end of evaluation, the evaluations by human are represented usually in terms of some of these key metrics:"}),"\n",(0,a.jsxs)(n.ul,{children:["\n",(0,a.jsx)(n.li,{children:"Risky %"}),"\n",(0,a.jsx)(n.li,{children:"Fabricating Info %"}),"\n",(0,a.jsx)(n.li,{children:"Response Quality %"}),"\n",(0,a.jsx)(n.li,{children:"Hallucination %"}),"\n"]}),"\n",(0,a.jsx)(n.p,{children:"The values for these KPIs are generated by Argilla on the basis of defined weightage for each parameter or question."}),"\n",(0,a.jsx)(n.p,{children:"Specific quality threshold are defined which have to be met for each of those KPIs before any new feature or agent is brought live into production. In case the generated numbers are below the acceptable value threshold then the system is handed back to the Engineers and Data scientists with appropriate feedbacks. Our team of Engineers and Data scientists, and Knowledge Ops members work together to ensure that appropriate optimizations are put into place to bring the system to an acceptable quality level, this can include prompt optimizations, RAG optimizations,\xa0etc."}),"\n",(0,a.jsx)(n.p,{children:"Once the new feature of agent meets an acceptable quality level, then the agent is put into the next phase of Business validation."}),"\n",(0,a.jsx)(n.p,{children:"In addition, recurring annotations are also done in production to evaluate our system on a weekly basis on the same quality KPIs."}),"\n",(0,a.jsx)(n.h4,{id:"business-validations",children:"Business Validations:"}),"\n",(0,a.jsx)(n.p,{children:"Since LMOS provides out of the box capabilities such as Blue Green and A/B, we are able to quickly deploy a new agent to a parallel beta test env on production infrastructure."}),"\n",(0,a.jsx)(n.p,{children:"Our team of Business domain experts assess the quality of response of the bot and provide their feedbacks. Based on these feedbacks the dev teams take appropriate actions to correct the prompts and/or supplement the bot with additional knowledge as needed."}),"\n",(0,a.jsx)(n.p,{children:"On reaching an appropriate quality threshold the agents are made live for real customers."}),"\n",(0,a.jsx)(n.h3,{id:"monitoring-and-improvements",children:"Monitoring and Improvements"}),"\n",(0,a.jsx)(n.p,{children:"Post go live, our teams continuously monitor the performance of the BOT. Continuous evaluation tools are used to keep an eye on the performance of the BOT.  Frequent manual quality assessments are also done using annotation tools like Argilla."}),"\n",(0,a.jsx)(n.p,{children:"Appropriate feedbacks noted from production monitoring & quality validations are noted in the backlog as improvement tasks, which are further prioritized and taken up into the sprints."}),"\n",(0,a.jsx)(n.h4,{id:"differences---agents-vs-traditional-development",children:"Differences - Agents vs Traditional development"}),"\n",(0,a.jsx)(n.p,{children:"It is certainly evident to our Development Teams that the outcomes from different iterations of tests are quite unpredictable due to the nature of the LLM models. Our teams make their best attempts at reducing this degree of uncertainty by engaging in various tweaks to the prompts, sharing examples to the BOT, controlling temperature etc. parameters."}),"\n",(0,a.jsx)(n.p,{children:"This also brings with it the unpredictability in the estimates on the completion of such work which gets some of us thinking that some kind of unpredictability constant must be factored in while calculating the story point estimates for some of these stories."}),"\n",(0,a.jsx)(n.p,{children:"In addition, there are no established patterns of the kind that are usually found in traditional domains or applications centered around domain driven designs. This leads to our Teams doing more of experimentation, learning from it and then moving forward with data driven decision making."}),"\n",(0,a.jsx)(n.p,{children:"There are many ethical considerations which are also kept at the back of mind while designing such applications that leverage LLMs."})]})}function c(e={}){const{wrapper:n}={...(0,s.R)(),...e.components};return n?(0,a.jsx)(n,{...e,children:(0,a.jsx)(h,{...e})}):h(e)}},2170:(e,n,t)=>{t.d(n,{A:()=>a});const a=t.p+"assets/images/agent-development-3b8c82f5d85a72e8fff2bbbdf71e6a6f.png"},8453:(e,n,t)=>{t.d(n,{R:()=>o,x:()=>r});var a=t(6540);const s={},i=a.createContext(s);function o(e){const n=a.useContext(i);return a.useMemo((function(){return"function"==typeof e?e(n):{...n,...e}}),[n,e])}function r(e){let n;return n=e.disableParentContext?"function"==typeof e.components?e.components(s):e.components||s:o(e.components),a.createElement(i.Provider,{value:n},e.children)}}}]);